use configs;
update client_testproperties set maxopportunities = 999;
update client_testmode set maxopps = 999;
update client_testwindow set numopps= 999;
update client_timelimits set oppdelay= -1;
update client_timelimits set OppExpire = 1;
update client_testproperties set isselectable = 0 where clientname = 'SBAC_PT' and testid like 'SBAC_Perf%';

update configs.client_testproperties set isselectable= b'1' where clientname = 'SBAC_PT' and testid = 'SBAC-Perf-MATH-11';
update configs.client_testproperties set label = CONCAT('Perf Task ', label)
where clientname = 'SBAC_PT' and testid = 'SBAC-Perf-MATH-11' and label not like 'Perf Task%';
update configs.client_testproperties set isselectable= b'1' where clientname = 'SBAC_PT' and testid = 'SBAC-Perf-ELA-11';
